import React from 'react'
import {connect} from "react-redux";
import Layout from "../_layouts/default/Layout";

class SuggestContainer extends React.Component {

    render() {
        return (
            <Layout>
                <div>
                    Suggest Form
                </div>
            </Layout>
        )
    }
}

export default connect()(SuggestContainer)
